import React from 'react';
import afisha from "../../../img/afisha.jpg";
import "./container.scss"
const UnderHeader = () => {
    return (
        <div className="under_header">
            <img src={afisha}/>
            <div className="btn_reg">
                <div className="text_btn">Зарегистрироваться</div>
            </div>
            <div className="title_under">Финал
                в городе Волгоград
            </div>
            <div className="desc_under">Вас
                ждет большой розыгрыш призов, мощные проекты со всей страны и ГРАНДИОЗНОЕ фаер-шоу
            </div>
        </div>
    );
};

export default UnderHeader;
